//SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;
import "../data/AuctionData.sol";
import "../../../utils/State.sol";
import "../Interface/IRouter.sol";
import "../../../Interface/ISettings.sol";
import "../../../Interface/IVault.sol";
import "../../../Interface/IFactory.sol";


contract Auction is AuctionData {
    
    /// @notice An event emitted when a user updates their price
    event EntirePrice(uint price);

    /// @notice An event emitted when an auction starts
    event Start(address indexed buyer, uint price);

    /// @notice An event emitted when a bid is made
    event Bid(address indexed buyer, uint price);

    /// @notice An event emitted when an auction is won
    event Won(address indexed buyer, uint price);
    
    /// @notice An event emitted when update auction length
    event UpdateAuctionLength(uint256 length);
  
    function initialize() public {
        require(!initializer,"initialize :: Already initialized");
        initializer = !initializer;
        router = msg.sender;
        auctionLength = 2 minutes;
    }

    function setPrice(uint256 _price) public {
        require(IRouter(router).whiteList(msg.sender),"setPrice :: Caller permission error");
        EntireVaultPrice = _price;
        emit EntirePrice(_price);
    }
    
    function updateAuctionLength(uint256 _length) external {
        require(getVault().getEntireVaultState() == State.NftState.freedom, "update :: not update");
        require(msg.sender == IRouter(router).curator(), "update :: not curator");
        require(_length >= getSettings().minAuctionLength() && _length <= getSettings().maxAuctionLength(), "update :: invalid auction length");

        auctionLength = _length;
        emit UpdateAuctionLength(_length);
    }
    

    /// @notice kick off an auction. Must send reservePrice in ETH
    function start() external payable {
        require(getVault().getEntireVaultState() == State.NftState.freedom, "start :: no auction starts");
        require(EntireVaultPrice != 0,"start :: Entire vault price is zore");
        require(msg.value >= EntireVaultPrice, "start :: too low bid");

        auctionEnd = block.timestamp + auctionLength;

        getVault().safeSetState(address(0),0,State.NftState.occupied,"Auction");

        livePrice = msg.value;
        payable(getVaultAddress()).transfer(livePrice);
        winning = payable(msg.sender);

        getVault().noncallable(); 
        
        emit Start(winning, livePrice);
    }

    /// @notice an external function to bid on purchasing the vaults NFT. The msg.value is the bid amount
    function bid() external payable {
        require(getVault().getEntireVaultState() == State.NftState.occupied && utilCompareInternal(getVault().getEntireVaultActivity(),"Auction"), "bid :: auction is not live");
  
        uint256 increase = getSettings().minBidIncrease() + 1000;// 5%

        require(msg.value * 1000 >= livePrice * increase, "bid :: too low bid");
        require(block.timestamp < auctionEnd, "bid :: auction ended");
    
        // If bid is within 15 minutes of auction end, extend auction
        if (auctionEnd - block.timestamp <= 15 minutes) {
            // auctionEnd += 15 minutes;
            auctionEnd += 0 minutes;
        }

        payable(getVaultAddress()).transfer(msg.value);
        
        getVault().sendETH(winning, livePrice);

        livePrice = msg.value;
        winning = payable(msg.sender);
        emit Bid(winning, livePrice);
    }

    /// @notice an external function to end an auction after the timer has run out
    function end() external {
        require( getVault().getEntireVaultState() == State.NftState.occupied && utilCompareInternal(getVault().getEntireVaultActivity(),"Auction"), "end :: vault has already closed" );
        require(block.timestamp >= auctionEnd, "end :: auction live");

        IRouter(router).claimFees();

        // transfer NFT to winner
        getVault().sendNFTAssetIndex(getVault().getFreedomNFT(),winning);

        getVault().safeSetState(address(0),0,State.NftState.leave,"Auction");
        emit Won(winning, livePrice);
    }


    function utilCompareInternal(string memory a, string memory b) public view  returns (bool) {
        if (bytes(a).length != bytes(b).length) {
            return false;
        }
        for (uint i = 0; i < bytes(a).length; i ++) {
            if(bytes(a)[i] != bytes(b)[i]) {
                return false;
            }
        }
        return true;
    }

    function getVaultAddress() public view returns(address){
        return IRouter(router).vault();
    }

    function getVault() public view returns(IVault){
        return IVault(getVaultAddress());
    }

    function getSettings() public view returns(ISettings) {
        return ISettings(IRouter(router).settings());
    }
    
}

